css:
atom-workspace.theme-seti-ui .tab-bar .tab div.title {
  padding-left: 6px;
}
div.foldername-tabs {
  margin-left: 4px;
  width: 100%;
  display: inline-flex;
}
div.foldername-tabs > span.file {
  top: 6px;
}
div.foldername-tabs > span.file.file-only {
  top: 1px;
}
div.foldername-tabs > span.folder {
  top: -6px;
}
div.foldername-tabs > span {
  position: absolute;
}
div.foldername-tabs > span.file {
  font-size: 1.025em;
}
div.foldername-tabs > span.folder {
  font-size: 0.9em;
}
atom-workspace.theme-isotope-ui ul.tab-bar > li.tab[is="tabs-tab"] {
  background: #21252b;
  overflow: hidden;
}
